  const mobile = window.matchMedia('(max-width: 475px)');
  let modeMobile =  mobile ? `url(${headerMobile})` : `url(${headerDesktop});`


  function show (e){
    const text = e.target.textContent
    setSelectedItems([text])
    setShowBox(true)
  }
